import React from "react";

const TopThree = ({ students }) => {
  return (
    <div className="top-three">
      {students.map((s, index) => (
        <div key={index} style={{ border: "2px solid black", borderRadius: "50%", width: "100px", height: "100px", display: "flex", flexDirection: "column", justifyContent: "center", alignItems: "center" }}>
          <div>{index + 1}</div>
          <div>{s.full_name}</div>
          <div>{s.points}</div>
        </div>
      ))}
    </div>
  );
};

export default TopThree;
